import user_icon from '../../../asset/icon/user.svg'

export default function Submit() {
    return (
        <>
            <div>
                
            </div>
            <div>
                <p className='poppins'>William Kosasie</p>
                <div className='bg-gray-200 p-3 rounded-full'>
                    <img src={user_icon} alt="" width={15}/>
                </div>

            </div>
        </>
    )
}
